import Navbar from "./components/Navbar.js";
import Home from "./components/Home";
import Blogs from "./components/Blogs.js";

import "./styles.css";

export default function App() {
  let component
  switch (window.location.pathname){
    case "/":
      component = <App/>
      break
      case "/blogs":
        component = <Blogs/>
        break
        case "/netart":
          component = <Netart/>
          break
          case "/styleguide":
            component = <Styleguide/>
            break
  }
  return (
    <div className="App">
      <Navbar />
      <Component/>
      <Home />

    </div>
  );
}
